package dev.yafatek;import dev.yafatek.annotations.ApiAttributes;import dev.yafatek.models.ApiClientResponse;import dev.yafatek.networking.ApiClient;public class App {	public static void main(String[] args) {		doApiConnection();	}	@ApiAttributes(url = "https://misafir.app/api/v1/users/show_users/")	private static void doApiConnection() {		ApiClientResponse response = ApiClient.apiClientBuilder()				.url()				.inti()				.perform()				.retrieve();		System.out.println(response.getMessage());	}}